INSERT INTO `orders_stop_log` (`log_id`, `message`, `message_start_date`, `message_end_date`, `order_stop_date`, `order_end_date`, `status`) VALUES
(1, '<br><br>Hello Nagpur! <br> We need to do some maintenance every once in 2 months to help deliver you better quality food at your doorstep. So Zaikart will be closed only for today, but we shall be waiting for you right here from tomorrow. <br><br>Have a great Monday - Team Zaikart.</h3>', '2016-08-01 06:00:00', '2016-08-01 06:00:00', '2016-08-01 06:00:00', '2016-08-01 06:00:00', 'n'),
(2, '<br><br>Hello Nagpur!<br> We have to undergo maintainance once every month so that we can deliver you food with much more efficiency, so Zaikart will be closed on<br>5th September 2016 (Monday).<br> We''ll see you on Tuesday<br><br>- Team Zaikart.', '2016-09-02 06:00:00', '2016-09-06 06:00:00', '2016-09-05 06:00:00', '2016-09-06 06:00:00', 'n'),
(3, '<br><br>Hello Nagpur!<br> We have to undergo maintainance once every month so that we can deliver you food with much more efficiency, so Zaikart will be closed on<br>3rd October 2016 (Monday).<br><br>- Team Zaikart.', '2016-09-27 06:00:00', '2016-10-04 06:00:00', '2016-10-03 06:00:00', '2016-10-04 06:00:00', 'n'),
(4, '<br><br>Happy Diwali to our dear customers <br>May this festival bring light and joy to your lives, <br>We appreciate the love and support <br>you have been showering upon us, <br><br>Zaikart will be closed on 30th October 2016 <br>due to Diwali (Lakshmi Pujan) <br><br>See you on 31st October in the evening <br><br>Have fun guys  -  Team Zaikart', '2016-10-28 06:00:00', '2016-10-31 06:00:00', '2016-10-30 06:00:00', '2016-10-31 06:00:00', 'n'),
(5, '<br><br>Hello Nagpur!<br> We need to undergo maintenance once a month so that we can deliver you good hygienic food with much efficiency, so Zaikart will be closed on<br> 23rd November 2016 (Wednesday).<br><br>- Team Zaikart.', '2016-11-22 06:00:00', '2016-11-24 06:00:00', '2016-11-23 06:00:00', '2016-11-24 06:00:00', 'y');
